const data = {
  logoWhite:
    'data:image/svg+xml;base64,',
  logoBlack:
    'data:image/svg+xml;base64,',
}

const measureTextHeight = (ctx: any, left: any, top: any, width: any, height: any) => {
  // Draw the text in the specified area
  ctx.save()
  ctx.translate(left, top + Math.round(height * 0.8))
  ctx.fillText('gM', 0, 0) // This seems like tall text...  Doesn't it?
  ctx.restore()

  // Get the pixel data from the canvas
  const data = ctx.getImageData(left, top, width, height).data
  let first: any = false
  let last: any = false
  let r = height
  let c = 0

  // Find the last line with a non-white pixel
  while (!last && r) {
    r--
    for (c = 0; c < width; c++) {
      if (data[r * width * 4 + c * 4 + 3]) {
        last = r
        break
      }
    }
  }

  // Find the first line with a non-white pixel
  while (r) {
    r--
    for (c = 0; c < width; c++) {
      if (data[r * width * 4 + c * 4 + 3]) {
        first = r
        break
      }
    }

    // If we've got it then return the height
    if (first !== r) return last - first
  }

  // We screwed something up...  What do you expect from free code?
  return 0
}

const getImageScale = (canvasWidth: any, canvasHeight: any, imageWidth: any, imageHeight: any) => {
  const scale = Math.min(canvasWidth / imageWidth, canvasHeight / imageHeight)
  return scale / 4 // Return 25% of image width size;
}
const setPosition = (
  canvasWidth: any,
  canvasHeight: any,
  imageWidth: any,
  imageHeight: any,
  position: any,
) => {
  const offsetPadding = 50
  const scale = getImageScale(canvasWidth, canvasHeight, imageWidth, imageHeight)

  // Cannot use scale here for padding.
  // Because different browsers interpret scale differently
  // so needs to be fixed value.
  const xPadding = offsetPadding
  const yPadding = offsetPadding

  const newImageWidth = imageWidth * scale
  const newImageHeight = imageHeight * scale

  const positions: any = {
    topLeft: {
      x: xPadding,
      y: newImageHeight,
    },
    topRight: {
      x: canvasWidth - newImageWidth - xPadding,
      y: newImageHeight,
    },
    bottomLeft: {
      x: xPadding,
      y: canvasHeight - yPadding,
    },
    bottomRight: {
      x: canvasWidth - newImageWidth,
      y: canvasHeight - yPadding,
    },
  }
  return positions[position]
}

const getLines = (context: any, text: string, maxWidth: any) => {
  const words = text.split(' ')
  const lines = []
  let currentLine = words[0]
  for (let i = 1; i < words.length; i++) {
    const word = words[i]
    const width = context.measureText(currentLine + ' ' + word).width
    if (width < maxWidth) {
      currentLine += ' ' + word
    } else {
      lines.push(currentLine)
      currentLine = word
    }
  }
  lines.push(currentLine)
  return lines
}

const getCenterYTextPosition = (textPosition: string, height: number, textHeight: number) => {
  const textOffset = 100

  if (textPosition === 'top') {
    return textOffset
  }

  if (textPosition === 'bottom') {
    return height - textOffset - textHeight
  }

  // vertically center text
  return height / 2 - textHeight / 2
}

const getLinesForParagraphs = (context: any, text: string, maxWidth: number) => {
  const lines = text.split('\n')
  return lines
    .map(function (paragraph) {
      return getLines(context, paragraph, maxWidth)
    }, this)
    .reduce((a, b) => {
      return a.concat(b)
    })
}

const getSvgBase64 = (element: any) => {
  const SVG: any = document?.getElementById(element)
  const svg = new XMLSerializer().serializeToString(SVG)
  const encodedData = window.btoa(svg)
  return encodedData
}

const clearCanvas = (context: any, width: number, height: number) => {
  context.clearRect(0, 0, width, height)
}

const headerLogoBase64 =
  'data:image/jpeg;base64,'

export {
  clearCanvas,
  data,
  getCenterYTextPosition,
  getImageScale,
  getLines,
  getLinesForParagraphs,
  getSvgBase64,
  measureTextHeight,
  setPosition,
  headerLogoBase64,
}
